import React from 'react';
import './Navbar.css';
function Navbar() {
  return (
    <div className='navbar'>
{/*  
   <h2>METAVERSE</h2> */}
    <ul>
        <li>Home</li>
        <li>About Us</li>
        <li>Pricing</li>
        <li>SignUp</li>
        <li>LogIn</li>
        <li><i class="fa-solid fa-gear"></i></li>

    </ul>
 
    </div>
  )
}

export default Navbar
